import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker'; // Importamos el archivo de service worker

// Renderizamos la aplicación en el DOM
ReactDOM.render(<App />, document.getElementById('root'));

// Activamos el service worker solo en producción para permitir el uso offline
serviceWorker.register();

// React 18+ necesita usar `createRoot` para renderizar la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);

// Si quieres que tu aplicación funcione sin conexión y cargue más rápido,
// puedes cambiar unregister() a register() abajo. Ten en cuenta que esto viene con algunos inconvenientes.
// Aprende más sobre service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
